import './App.css';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Admin from './page/admin/Admin';
import Home from './page/home/Home';

function App() {
  return (

    <BrowserRouter>
    <Routes>
    <Route path='/'element={<Home/>}></Route>
       <Route path='/admin'element={<Admin/>}></Route>

   </Routes>
   </BrowserRouter>
  );
}

export default App;
